import React , {Component } from 'react'

class Input extends Component {
    constructor(props) {
        super (props)
    }

    render() {
        return(
            <div>
                Enter your bill amount
                <br/>
                <input type='text'/>
                <br/>
                How was the service
                <select >
                    <option value="0">Please select the option</option>
                    <option value='0.2'>Excelent - 20%</option>
                    <option value='0.1'>Moderate - 10%</option>
                    <option value='0.05'>Bad - 5%</option>
                </select>
                <input type = 'text' placeholder ='Customer Name'></input>
                <input type = 'button' >Add Customer</input>
            </div>
        )
    }
    
}
